import Link from 'next/link';
import Header from '../comps/Header';

const Index = () => (
    <div>
        <Header/>
        <p>Hello Next.js</p>
        <Link href="/contact">
            <a title="Contact Page">Contact Page</a>
        </Link>
        <Link href="/about">
            <a title="About Page">About Page</a>
        </Link>
        <br/> 
        <Link href="/about">
            <button>Go to About Page</button>
        </Link>
    </div>
  );

  export default Index;
